# 保存先ディレクトリ
save_dir = "./.datasets/images"
os.makedirs(save_dir, exist_ok=True)
index=0
for url in urls:
    response = requests.get(url)
    if response.status_code == 200:
        # ファイル名と拡張子の取得
        parsed_url = urlparse(url)
        file_name = os.path.basename(parsed_url.path)
        file_name = unquote(file_name)+str(index)
        if not os.path.splitext(file_name)[1]:  # 拡張子がない場合
            mime_type = response.headers.get('Content-Type', '')
            ext = mimetypes.guess_extension(mime_type)
            file_name += ext if ext else '.jpg'  # デフォルトは.jpg
        file_path = os.path.join(save_dir, file_name)
        
        # ファイルに書き込み
        with open(file_path, 'wb') as file:
            file.write(response.content)
        print(f"Downloaded {url} as {file_path}")
    else:
        print(f"Failed to download {url}")
    index+=1
# base64画像データの保存
for  data_url in base64_images:
    header, encoded = data_url.split(",", 1)
    file_ext = header.split(";")[0].split("/")[1]
    file_name = os.path.join(save_dir, f"base64_image_{str(index)}.{file_ext}")
    
    # ファイルに書き込み
    with open(file_name, 'wb') as file:
        file.write(base64.b64decode(encoded))
    print(f"Saved base64 image {index} as {file_name}")
    index+=1